INSERT INTO `aiml` VALUES(15235, "<category><pattern>DOES NEEDLE EXCHANGE INCREASE DRUG *</pattern><template> No. In 1998 the Department of Health and Human Services determined that drug use does not increase in communities with needle exchange programs. Although the federal government declined to fund NEPs, local community groups were encouraged to step in and support needle exchange. </template></category>", "DOES NEEDLE EXCHANGE INCREASE DRUG *", "", " No. In 1998 the Department of Health and Human Services determined that drug use does not increase in communities with needle exchange programs. Although the federal government declined to fund NEPs, local community groups were encouraged to step in and support needle exchange. ", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15236, "<category><pattern>DOES NEEDLE EXCHANGE PREVENT TRANSMISSION *</pattern><template> Repeated scientific studies say yes. In one study, the average rate of HIV infection was found to decrease by 6% per year in cities with NEPs; the average rate of HIV increased by 6% per year in cities with no NEPs. </template></category>", "DOES NEEDLE EXCHANGE PREVENT TRANSMISSION *", "", " Repeated scientific studies say yes. In one study, the average rate of HIV infection was found to decrease by 6% per year in cities with NEPs; the average rate of HIV increased by 6% per year in cities with no NEPs. ", "", "Drugs.aiml")
