INSERT INTO `aiml` VALUES(15245, "<category><pattern>HOW LARGE IS THE HEPATITIS C PROBLEM</pattern> <template> A large number of Americans were infected with Hepatitis C through the blood supply, which was not systematically screened for the virus until 1992. 720 Georgians have been diagnosed with Hepatitis C disease since 1993; many more are infected but not ill. Since the blood supply is now safe and the virus is not easily transmitted sexually, most new cases of Hepatitus C are attributable to injection drug use. </template></category>", "HOW LARGE IS THE HEPATITIS C PROBLEM", "", " A large number of Americans were infected with Hepatitis C through the blood supply, which was not systematically screened for the virus until 1992. 720 Georgians have been diagnosed with Hepatitis C disease since 1993; many more are infected but not ill. Since the blood supply is now safe and the virus is not easily transmitted sexually, most new cases of Hepatitus C are attributable to injection drug use. ", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15246, "<category><pattern>HOW LARGE IS THE HIV AIDS *</pattern><template> Nationally there have been over 600,000 people diagnosed with AIDS since 1981. 25% if AIDS cases were linked to injection drug use. An unknown number of Americans are infected with HIV. Georgia, with approximately 18,700 cases reported since 1981, ranks among the top ten states with the most AIDS cases. As many as 30,000 Georgians are estimated to be infected with HIV; 20% of 1998 AIDS diagnoses were linked to injection drug use. In Atlanta, there is an estimated 20,000 injection drug users. It is not known how many are infected with HIV. </template></category>", "HOW LARGE IS THE HIV AIDS *", "", " Nationally there have been over 600,000 people diagnosed with AIDS since 1981. 25% if AIDS cases were linked to injection drug use. An unknown number of Americans are infected with HIV. Georgia, with approximately 18,700 cases reported since 1981, ranks among the top ten states with the most AIDS cases. As many as 30,000 Georgians are estimated to be infected with HIV; 20% of 1998 AIDS diagnoses were linked to injection drug use. In Atlanta, there is an estimated 20,000 injection drug users. It is not known how many are infected with HIV. ", "", "Drugs.aiml")
