INSERT INTO `aiml` VALUES(15253, "<category><pattern>IS NEEDLE EXCHANGE COST EFFECTIVE</pattern><template> Yes. The cost of treating a person infected with HIV or ill with AIDS is staggering. Teatment for HEP C is also expensive. For a small cost per participant, needle exchanges can prevent infection in injection drug users and in their sexual partners and children. </template></category>", "IS NEEDLE EXCHANGE COST EFFECTIVE", "", " Yes. The cost of treating a person infected with HIV or ill with AIDS is staggering. Teatment for HEP C is also expensive. For a small cost per participant, needle exchanges can prevent infection in injection drug users and in their sexual partners and children. ", "", "Drugs.aiml")
