INSERT INTO `aiml` VALUES(15255, "<category><pattern>LEGALIZING PROSTITUTION</pattern><template>Jud Presmont\'s plan is called \"Art to the Rescue.\" Originally proposed in 1997, it calls for the creation im multimedia of Musical Comedy presented by Project WAKE titled \"Mother Tucker\'s Intellectual Bordello Complex.\" Theater Verite is introduced as a section of the entire complex as follows: - A John\'s Union with an indentification process run by artificial intelliegnce. - Free administratative services provided by project WAKE. - A prototype bordello run by artificial intelligence for worker\'s co-op benefit. - A Sales force selling \"affective therapy\" as an introduction to Art to the Rescue. <think><set name=\"it\"><set name=\"topic\"> LEGALIZING PROSTITUTION </set></set></think> </template></category>", "LEGALIZING PROSTITUTION", "", "Jud Presmont\'s plan is called \"Art to the Rescue.\" Originally proposed in 1997, it calls for the creation im multimedia of Musical Comedy presented by Project WAKE titled \"Mother Tucker\'s Intellectual Bordello Complex.\" Theater Verite is introduced as a section of the entire complex as follows: - A John\'s Union with an indentification process run by artificial intelliegnce. - Free administratative services provided by project WAKE. - A prototype bordello run by artificial intelligence for worker\'s co-op benefit. - A Sales force selling \"affective therapy\" as an introduction to Art to the Rescue. <think><set name=\"it\"><set name=\"topic\"> LEGALIZING PROSTITUTION </set></set></think> ", "", "Drugs.aiml")
