INSERT INTO `aiml` VALUES(15264, "<category><pattern>WHAT IS SOCIETY B</pattern><template>The players in Society B conceptualize and theatricize reality by creating a positive vision of the future in future virtual reality. It\'s known as \"Virtual Future\", where all major social problems have been solved through visualization and art. <think><set name=\"it\"><set name=\"topic\"> Society B </set></set></think> </template></category>", "WHAT IS SOCIETY B", "", "The players in Society B conceptualize and theatricize reality by creating a positive vision of the future in future virtual reality. It\'s known as \"Virtual Future\", where all major social problems have been solved through visualization and art. <think><set name=\"it\"><set name=\"topic\"> Society B </set></set></think> ", "", "Drugs.aiml")
