INSERT INTO `aiml` VALUES(15266, "<category><pattern>WHAT IS THE COSMIC OPERA</pattern><template>The plot of the Cosmic Opera tells the story of how the Business Driven Peace Corp was born. In the theatrical context, the players are conceptualizing and designing a blockbuster art exhibition which is based in California and which launches other traveling exhibits for worldwide exhibits. <think><set name=\"it\"><set name=\"topic\"> The Cosmic Opera </set></set></think></template></category>", "WHAT IS THE COSMIC OPERA", "", "The plot of the Cosmic Opera tells the story of how the Business Driven Peace Corp was born. In the theatrical context, the players are conceptualizing and designing a blockbuster art exhibition which is based in California and which launches other traveling exhibits for worldwide exhibits. <think><set name=\"it\"><set name=\"topic\"> The Cosmic Opera </set></set></think>", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15267, "<category><pattern>WHAT IS THE LEGAL STATUS OF NEEDLE EXCHANGES</pattern><template> Laws instituted before HIV hinder the implementation of comprehensive prevention programs, including needle exchange. Injection drug users have no reasonable access to cleans needles in Georgia. Other U.S. communities have declared medical emergencies or sought waivers to afford NEPs legal status. </template></category>", "WHAT IS THE LEGAL STATUS OF NEEDLE EXCHANGES", "", " Laws instituted before HIV hinder the implementation of comprehensive prevention programs, including needle exchange. Injection drug users have no reasonable access to cleans needles in Georgia. Other U.S. communities have declared medical emergencies or sought waivers to afford NEPs legal status. ", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15268, "<category><pattern>WHAT IS WEED</pattern><template>Any undersired, uncultivated plant, especially growing in profusion so as to crowd out a desired crop, disfigure a lawn, etc. Also a term for marijuana.</template></category>", "WHAT IS WEED", "", "Any undersired, uncultivated plant, especially growing in profusion so as to crowd out a desired crop, disfigure a lawn, etc. Also a term for marijuana.", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15269, "<category><pattern>WHO ENDORSES NEEDLE EXCHANGE</pattern><template> The American Medical Association The American Psychiatric Association The American Public Health Association The American Society of Addiction Medicine The Centers for Disease Control and Prevention The National Academy of Sciences The U.S. Conference of Mayors The National Black Caucus of State Legislators The National Institute for Drug Abuse The National Institutes for Health The New England Journal of Medicine The World Health Organization The Lancet The National Academy of Social Workers ...and more. </template></category>", "WHO ENDORSES NEEDLE EXCHANGE", "", " The American Medical Association The American Psychiatric Association The American Public Health Association The American Society of Addiction Medicine The Centers for Disease Control and Prevention The National Academy of Sciences The U.S. Conference of Mayors The National Black Caucus of State Legislators The National Institute for Drug Abuse The National Institutes for Health The New England Journal of Medicine The World Health Organization The Lancet The National Academy of Social Workers ...and more. ", "", "Drugs.aiml")
INSERT INTO `aiml` VALUES(15270, "<category><pattern>WHY IS NEEDLE EXCHANGE *</pattern><template> People infected with HIV (the virus that causes AIDS), Hepatitis C, and other diseases when they share needles. Both HIV and Hepatitis C can be fatal. Since these diseases cannot currently be cured, prevention is the key tot taming the two epidemics. Needle exchange programs (NEPs) provide clean needles to injectors to prevent infection. </template></category>", "WHY IS NEEDLE EXCHANGE *", "", " People infected with HIV (the virus that causes AIDS), Hepatitis C, and other diseases when they share needles. Both HIV and Hepatitis C can be fatal. Since these diseases cannot currently be cured, prevention is the key tot taming the two epidemics. Needle exchange programs (NEPs) provide clean needles to injectors to prevent infection. ", "", "Drugs.aiml")
